import { ListItem, List, Container, Typography, Button } from '@mui/material';
import { styled } from '@mui/system';

const UserList = styled(List)({
  border: '1px solid #ccc',
  borderRadius: '5px',
  padding: '10px',
});

const UserListItem = styled(ListItem)({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
});

const UserName = styled(Typography)({
  fontWeight: 'bold',
});

const GroupTitle = styled(Typography)({
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  });

  const EditButton = styled(Button)({
    margin: '16px 0',
    fontWeight: 'bold',
    color: 'white',
    background: '#2e7d32',
    '&:hover': {
      background: '#1b5e20',
    },
  });

function GroupUsers({ users, user }) {
  console.log(users);

  const renderUsers = users.map((thisUser) => {
    if (user.id === thisUser.id) {
      return null;
    }

    return (
      <Container key={thisUser.id}>
            <ListItem>{thisUser.name}</ListItem>
      </Container>
    );
  });

  return (
    <Container>
      <Typography >
        Users
      </Typography>
      {renderUsers}
    </Container>
  );
}

export default GroupUsers;
